import { noticeSave, productSave } from "./save";
import {
    getNotices,
    getOneNotice,
    getOneProduct,
    getProducts,
    getCategories,
} from "./load";
import { noticeDelete, productDelete } from "./delete";

export {
    getOneNotice,
    getOneProduct,
    getNotices,
    getProducts,
    getCategories,
    noticeDelete,
    noticeSave,
    productSave,
    productDelete,
};
